import { gql, useQuery } from '@apollo/client';

export const CURRENT_USER_QUERY = gql`
  query {
    me {
    id
    username
    email
      }
  }
`;

export function useUser() {
    const { data } = useQuery(CURRENT_USER_QUERY, {
        variables:  { Authorization: "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxMWI2OTBmOTQ3OTMyOTkzZjE4NjA5YyIsImlhdCI6MTYyOTQ0NTU1MCwiZXhwIjoxNjMyMDM3NTUwfQ.5P4xcm8ceokw61oOwItulXWTrpbkv8216viOMuVeguY" }
    });
    return data;
}
